CREATE TABLE user ( id BIGINT NOT NULL, name VARCHAR(30) NOT NULL, gender VARCHAR(10) NULL, birth DATE NULL, address VARCHAR(100) NULL, email VARCHAR(30) NULL, created_at DATETIME NULL, updated_at DATETIME NULL, point INT NULL, CONSTRAINT PK_USER PRIMARY KEY (id) );
CREATE TABLE mission ( id BIGINT NOT NULL, store_id BIGINT NOT NULL, name VARCHAR(30) NOT NULL, description VARCHAR(50) NULL, CONSTRAINT PK_MISSION PRIMARY KEY (id, store_id) );
CREATE TABLE genre ( id BIGINT NOT NULL, name VARCHAR(36) NOT NULL, CONSTRAINT PK_GENRE PRIMARY KEY (id) );
CREATE TABLE user_genre ( user_id BIGINT NOT NULL, genre_id BIGINT NOT NULL, CONSTRAINT PK_USER_GENRE PRIMARY KEY (user_id, genre_id) );
CREATE TABLE user_mission ( user_id BIGINT NOT NULL, mission_id BIGINT NOT NULL, status VARCHAR(15) NOT NULL, created_at DATETIME NULL, updated_at DATETIME NULL, CONSTRAINT PK_USER_MISSION PRIMARY KEY (user_id, mission_id) );
CREATE TABLE review ( user_id BIGINT NOT NULL, store_id BIGINT NOT NULL, score VARCHAR(10) NULL, description VARCHAR(500) NULL, photo_url VARCHAR(255) NULL, CONSTRAINT PK_REVIEW PRIMARY KEY (user_id, store_id) );
CREATE TABLE region ( id BIGINT NOT NULL, region_name VARCHAR(20) NOT NULL, CONSTRAINT PK_REGION PRIMARY KEY (id) );
CREATE TABLE store ( id BIGINT NOT NULL, region_id BIGINT NOT NULL, store_name VARCHAR(20) NOT NULL, store_address VARCHAR(100) NULL, CONSTRAINT PK_STORE PRIMARY KEY (id, region_id) );
ALTER TABLE mission ADD CONSTRAINT FK_store_TO_mission_1 FOREIGN KEY (store_id) REFERENCES store (id);
ALTER TABLE user_genre ADD CONSTRAINT FK_user_TO_user_genre_1 FOREIGN KEY (user_id) REFERENCES user (id);
ALTER TABLE user_genre ADD CONSTRAINT FK_genre_TO_user_genre_1 FOREIGN KEY (genre_id) REFERENCES genre (id);
ALTER TABLE user_mission ADD CONSTRAINT FK_user_TO_user_mission_1 FOREIGN KEY (user_id) REFERENCES user (id);
ALTER TABLE user_mission ADD CONSTRAINT FK_mission_TO_user_mission_1 FOREIGN KEY (mission_id) REFERENCES mission (id);
ALTER TABLE review ADD CONSTRAINT FK_user_TO_review_1 FOREIGN KEY (user_id) REFERENCES user (id);
ALTER TABLE review ADD CONSTRAINT FK_store_TO_review_1 FOREIGN KEY (store_id) REFERENCES store (id);
ALTER TABLE store ADD CONSTRAINT FK_region_TO_store_1 FOREIGN KEY (region_id) REFERENCES region (id);

