-- 6. mission INSERT INTO mission (id, store_id, name, description) VALUES (1, 1, '제육 정식 먹기', '김밥천국에서 제육 정식 먹어보기'), (2, 1, '돈까스 도전', '김밥천국에서 돈까스 먹기'), (3, 2, '백반 메뉴 먹기', '백반집에서 대표 메뉴 먹기');
-- 7. user_mission INSERT INTO user_mission (user_id, mission_id, status, created_at, updated_at) VALUES (7, 1, '진행중'), (7, 2, '진행완료');
-- 8. review INSERT INTO review (user_id, store_id, score, description) VALUES ( 7, 1, '5', '음 너무 맛있어요 포인트도 얻고 맛있는 맛집도 알게 된 것 같아 너무나도 행복한 식사였답니다. 다음에 또 올게요!!' );
SELECT * FROM mission as m JOIN user_mission AS um ON m.id = um.mission_id WHERE um.user_id = 7 AND(um.status = '진행중' OR um.status = '진행완료') ORDER BY um.created_at desc, m.id desc limit 15; LIMIT 15 OFFSET 0; --내가 진행중, 진행 완료한 미션 모아서 보는 쿼리(페이징 포함)
SELECT m.*, s.store_name FROM mission AS m JOIN store AS s ON m.store_id = s.id LEFT JOIN user_mission AS um ON m.id = um.mission_id AND um.user_id = 7 WHERE s.region_id = 1 AND um.user_id IS NULL ORDER BY m.id DESC LIMIT 15 OFFSET 0; --홈 화면 쿼리 --(현재 선택 된 지역에서 도전이 가능한 미션 목록, 페이징 포함)
SELECT name, email, point FROM user WHERE id = 7; -- 마이페이지 화면 쿼리

CREATE DATABASE IF NOT EXISTS umc_db;

USE umc_db;

CREATE TABLE user (
    id BIGINT NOT NULL,
    name VARCHAR(30) NOT NULL,
    gender VARCHAR(10) NULL,
    birthdate DATE NULL,
    address VARCHAR(100) NULL,
    email VARCHAR(30) NULL,
    created_at DATETIME NULL,
    updated_at DATETIME NULL,
    point INT NULL,
    CONSTRAINT PK_USER PRIMARY KEY (id)
);

CREATE TABLE mission (
    id BIGINT NOT NULL,
    store_id BIGINT NOT NULL,
    name VARCHAR(30) NOT NULL,
    description VARCHAR(50) NULL,
    CONSTRAINT PK_MISSION PRIMARY KEY (id, store_id)
);

CREATE TABLE genre (
    id BIGINT NOT NULL,
    name VARCHAR(36) NOT NULL,
    CONSTRAINT PK_GENRE PRIMARY KEY (id)
);

CREATE TABLE user_genre (
    user_id BIGINT NOT NULL,
    genre_id BIGINT NOT NULL,
    CONSTRAINT PK_USER_GENRE PRIMARY KEY (user_id, genre_id)
);

CREATE TABLE user_mission (
    user_id BIGINT NOT NULL,
    mission_id BIGINT NOT NULL,
    status VARCHAR(15) NOT NULL,
    created_at DATETIME NULL,
    updated_at DATETIME NULL,
    CONSTRAINT PK_USER_MISSION PRIMARY KEY (user_id, mission_id)
);

CREATE TABLE review (
    user_id BIGINT NOT NULL,
    store_id BIGINT NOT NULL,
    score VARCHAR(10) NULL,
    description VARCHAR(500) NULL,
    photo_url VARCHAR(255) NULL,
    CONSTRAINT PK_REVIEW PRIMARY KEY (user_id, store_id)
);

CREATE TABLE region (
    id BIGINT NOT NULL,
    region_name VARCHAR(20) NOT NULL,
    CONSTRAINT PK_REGION PRIMARY KEY (id)
);

CREATE TABLE store (
    id BIGINT NOT NULL,
    region_id BIGINT NOT NULL,
    store_name VARCHAR(20) NOT NULL,
    store_address VARCHAR(100) NULL,
    CONSTRAINT PK_STORE PRIMARY KEY (id, region_id)
);

